import React, { Component } from "react";

class RulesIngestion extends Component {
  state = {};

  render() {
    return (
      <div className="ingestion-container">
        <div className="row">
          <div className="col-2"></div>
          <div className="col"></div>
        </div>
      </div>
    );
  }
}

export default RulesIngestion;
